    return (
        <form>
            <label for="email">Email</label>
            <input type="email" placeholder="Email" id="email" name ="email"/>
            <br></br>

            <label for="password">Password</label>
            <input type="password" placeholder="********" id="password" name ="password"/>
            <button>Log In</button>

        </form>

    )




}
